import React from "react";
import { Link } from 'react-router-dom';


const Home = () => {
    return (
        <div className="container segment">
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
            <Link to={'abs'}>Abs Exercise</Link>
        </div>
    )
}

export default Home;
